import React from 'react';

const Navbar = () => {
  const navbarItems = [
    { href: "#about", icon: "fas fa-info", text: "About" },
    { href: "#services", icon: "fas fa-bars", text: "Services" },
    { href: "#resume", icon: "fas fa-file-alt", text: "Resume" },
    { href: "#portfolio", icon: "fas fa-th-list", text: "Portfolio" },
    { href: "#contact", icon: "fas fa-envelope", text: "Contact" }
  ];

  return (
    <nav className="navbar is-link is-fixed-top">
      <div className="navbar-brand">
        <div className="navbar-burger burger" data-target="navbarExampleTransparentExample">
          <span></span>
          <span></span>
          <span></span>
        </div>
      </div>
      <div id="navbarExampleTransparentExample" className="navbar-menu">
        <div className="navbar-end">
          {navbarItems.map((item, index) => (
            <a key={index} className="navbar-item" href={item.href}>
              <span className="icon">
                <i className={item.icon}></i>
              </span>
              <span>{item.text}</span>
            </a>
          ))}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
